import React, {Component} from 'react';
import './event-condensed.css';


class EventCondensed extends Component {
    
     constructor(props){
        super(props);
                    
    }
   
    
    render(){
        return(
            <li className="event-condensed">                        
                <h1 className="text-light event-title">{this.props.event.title}</h1>
                <p className="text-light">{this.props.event.people}</p>
            </li>     
        )
    }
}

export default EventCondensed;
